import React from 'react';

import { Link } from 'react-router-dom';

function MediumSofa() {
    return (
        <div>
            <h1>Sofas</h1>
            <Link to="/"><p>Nuestros Modelos</p></Link>
            <Link><p>Personalizalo</p></Link>
        </div>
    )
}

export default MediumSofa;
